import React from "react";
import s from "./AboutUsPage.module.css";
import ContentContainer from "../content-container";
import Logo from "../../assets/images/sousmate.png";
import Team from "../../assets/images/team.jpg";

export default function AboutUsPage() {
  return (
    <div className={s.AboutUsPage}>
      <ContentContainer>
        <div className={s.InfoAbout}>
          <div className="about-content">
            <h1>About Us</h1>

            <img src={Logo} alt="Sousmate Logo" />

            <p className={s.AboutUsMsg}>
              Sousmate has existed more than 10 years, and we have about 1
              million subscribers. We like to cook like you, and we are glad to
              help you make your favorite recipes and simplify this process.
            </p>
            <img src={Team} alt="Sousmate team" />
            <p className={s.AboutUsMsg2}>
              Sousmate has about 100 employees, and our site is constantly being
              improved and updated so that you can easily find the recipes that
              suit your whole family, and according to the time you have to cook
              it. <span>Enjoy cooking even more with us!</span>
            </p>
          </div>
        </div>
      </ContentContainer>
    </div>
  );
}
